import Carousel from 'react-bootstrap/Carousel';
import "./carousssel.css"

function UncontrolledExample() {

  const Data = [

    { id:1 , img:'/Ertugrul.jpg' ,title:"", alt:'diirilis'},
    { id:2 , img:'/Abdelhamit.jpg',title:"Abdelhamit" , alt:'payiith' },
  
  ]
    

  return (

    <div>
    {Data.map((item)=>{
      return(
    <Carousel className='caroussel'>
      <Carousel.Item>
      <img className="d-block w-100" src={item.img}  alt='ertugrul'/>
        <Carousel.Caption>
          <h3></h3>
        </Carousel.Caption>
      </Carousel.Item>
      </Carousel>
     );
    } )}
      </div>
  );
}

export default UncontrolledExample;
